tables.table_schema:
CREATE TABLE chat_logs (
    id INT PRIMARY KEY,
    message TEXT,
    sender VARCHAR,
    timestamp TIMESTAMP
);

CREATE TABLE chat_logs (
    log_id INT PRIMARY KEY,
    user_id INT,
    message TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE meeting_notes (
    note_id INT PRIMARY KEY,
    meeting_id INT,
    user_id INT,
    note TEXT
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50),
    email VARCHAR(100),
    role VARCHAR(20)
);

CREATE TABLE meetings (
    id UUID PRIMARY KEY,
    topic TEXT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);

CREATE TABLE team_members (
    id UUID PRIMARY KEY,
    name TEXT,
    email TEXT,
    role TEXT
);

CREATE TABLE team_roles (
    id UUID PRIMARY KEY,
    role_name TEXT
);
